import React from 'react';
import styled from 'styled-components';
import { motion } from 'framer-motion';
import { Link } from 'react-router-dom';
import whatsappIcon from '../assets/whatsapp_icon.png'; // Certifique-se de ter um ícone do WhatsApp na pasta assets


const Home = () => {
  return (
    <HomeContainer>
      <HeroSection>
        <HeroText
          initial={{ opacity: 0, y: -50 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.5 }}
        >
          <h1>Bem-vindo à Pousada Pinheira</h1>
          <p>O destino perfeito para suas férias inesquecíveis</p>
        </HeroText>
      </HeroSection>
      <ContentSection>
        <Card
          initial={{ opacity: 0, scale: 0.8 }}
          whileInView={{ opacity: 1, scale: 1 }}
          transition={{ duration: 0.5 }}
        >
          <img src="http://www.pousadapinheira.com.br/img/paginas/2/Acomodacoes_8.jpg" alt="Acomodações" />
          <CardContent>
            <h2>Acomodações</h2>
            <p>Descanse em nossas confortáveis e bem equipadas acomodações.</p>
            <Link to="/accommodations">Saiba Mais</Link>
          </CardContent>
        </Card>
        <Card
          initial={{ opacity: 0, scale: 0.8 }}
          whileInView={{ opacity: 1, scale: 1 }}
          transition={{ duration: 0.5 }}
        >
          <img src="http://www.pousadapinheira.com.br/img/paginas/2/Acomodacoes_8.jpg" alt="Café da Manhã" />
          <CardContent>
            <h2>Café da Manhã</h2>
            <p>Aproveite um café da manhã delicioso e completo.</p>
            <Link to="/breakfast">Saiba Mais</Link>
          </CardContent>
        </Card>
        <Card
          initial={{ opacity: 0, scale: 0.8 }}
          whileInView={{ opacity: 1, scale: 1 }}
          transition={{ duration: 0.5 }}
        >
          <img src="http://www.pousadapinheira.com.br/img/paginas/2/Acomodacoes_8.jpg" alt="Pacotes" />
          <CardContent>
            <h2>Pacotes</h2>
            <p>Confira nossos pacotes especiais para feriados e datas comemorativas.</p>
            <Link to="/packages">Saiba Mais</Link>
          </CardContent>
        </Card>
      </ContentSection>
    </HomeContainer>
  );
};

const HomeContainer = styled.div`
  padding: 20px;
  background-color: #b15a00;
  color: #333;
`;

const HeroSection = styled.div`
  background: url('http://www.pousadapinheira.com.br/img/site/container-bg.jpg') center/cover no-repeat;
  height: 60vh;
  display: flex;
  align-items: center;
  justify-content: center;
  margin-bottom: 50px;
`;

const HeroText = styled(motion.div)`
  text-align: center;
  color: white;
  h1 {
    font-size: 3rem;
    margin-bottom: 20px;
  }
  p {
    font-size: 1.5rem;
  }
`;

const ContentSection = styled.div`
  display: flex;
  flex-wrap: wrap;
  justify-content: space-around;
`;

const Card = styled(motion.div)`
  background-color: white;
  border-radius: 10px;
  box-shadow: 0 4px 8px rgba(0, 0, 0, 0.1);
  overflow: hidden;
  margin: 20px;
  max-width: 300px;
  img {
    width: 100%;
    height: 200px;
    object-fit: cover;
  }
`;

const CardContent = styled.div`
  padding: 20px;
  h2 {
    font-size: 1.5rem;
    margin-bottom: 10px;
    color: #008080;
  }
  p {
    font-size: 1rem;
    margin-bottom: 20px;
  }
  a {
    color: #008080;
    text-decoration: none;
    font-weight: bold;
  }
`;
const WhatsAppButton = styled.a`
  display: flex;
  align-items: center;
  justify-content: center;
  padding: 10px 20px;
  background-color: #25d366;
  color: white;
  text-decoration: none;
  font-size: 1.2rem;
  border-radius: 5px;
  transition: background-color 0.3s;

  img {
    width: 44px;
    height: 44px;
    margin-right: 10px;
  }

  &:hover {
    background-color: #1ebd59;
  }
`;
export default Home;
